import React from "react";
import {
  Card,
  CardHeader,
  Container,
  Row
} from "reactstrap";
import { BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';
import Header from "components/Headers/Header.jsx";

class Icons extends React.Component {
  state = {};
  render() {

    const data = [
        {
          id : 1,
          name : 'brian',
          email: '@brian@gmail.com'
        }
      ]

    const options = {
      sizePerPage: 20,
      hideSizePerPage: true,
    };
    return (
      <div>
        <Header />
        <Container className=" mt--7" fluid>
          <Row>
            <div className=" col">
              <Card className=" shadow">
                <CardHeader className=" bg-transparent">
                  <h3 className=" mb-0">List File</h3>
                </CardHeader><br/>
                <div className="container-fluid">
        <div className="row">
          <div className="col-md-12">
            <div className="card">
              <div className="content">
                <BootstrapTable
                  data={data}
                  bordered={false}
                  striped
                  pagination={true}
                  options={options}>
                  <TableHeaderColumn
                    dataField='id'
                    isKey
                    width="50px"
                    dataSort>
                    ID
                  </TableHeaderColumn>
                  <TableHeaderColumn
                    dataField='name'
                    width="15%"
                    dataSort>
                    Name
                  </TableHeaderColumn>
                  <TableHeaderColumn
                    dataField='email'
                    width="30%">
                    email
                  </TableHeaderColumn>
                  <TableHeaderColumn width="20%"></TableHeaderColumn>
                </BootstrapTable>
              </div>
            </div>
          </div>
        </div>
      </div>

              </Card>
            </div>
            </Row>
        </Container>
      </div>
    );
  }
}

export default Icons;
